import React from 'react';
import './CTABox.css';

export default function CTABox() {
  return (
    <div className="cta-box">
      <h2>Adopt or Join a Co-Development Idea!</h2>
      <button className="cta-button">Adopt Ideas</button>
    </div>
  );
}
